            <div class="article-image"><img src="http://run-ski.ru//app/uploads/2018/07/cd67fd253d8fb0389230474154104290.jpg" alt="Image –ø–æ—Å—Ç–∞"></div>
            <div class="article-info">
                <div class="post-date">28/07/2018</div>
            </div>
            <div class="article-text">
                <p>–ú–µ–∂–¥—É–Ω–∞—Ä–æ–¥–Ω–∞—è –∞—Å—Å–æ—Ü–∏–∞—Ü–∏—è –ª–µ–≥–∫–æ–∞—Ç–ª–µ—Ç–∏—á–µ—Å–∫–∏–π —Ñ–µ–¥–µ—Ä–∞—Ü–∏–π (IAAF) –Ω–∞ —Å–≤–æ—ë–º –æ—Ñ–∏—Ü–∏–∞–ª—å–Ω–æ–º —Å–∞–π—Ç–µ –æ–ø—É–±–ª–∏–∫–æ–≤–∞–ª–∞ —Å–ø–∏—Å–æ–∫ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏—Ü–∏—Ä–æ–≤–∞–Ω–Ω—ã—Ö –ª–µ–≥–∫–æ–∞—Ç–ª–µ—Ç–æ–≤ –ø–æ –∏—Ç–æ–≥–∞–º –ø—Ä–æ—à–µ–¥—â–µ–≥–æ –º–µ—Å—è—Ü–∞. –í –ª–∏–¥–µ—Ä–∞—Ö –ø–æ —á–∏—Å–ª—É –ø–æ–ø–∞–≤—à–∏—Ö—Å—è —Å–ø–æ—Ä—Ç—Å–º–µ–Ω–æ–≤ –ò–Ω–¥–∏—è –∏ –ò—Ç–∞–ª–∏—è.</p>
<p>  <span id="more-9266"></span>  </p>
<p>–ú–∏—à–µ–ª—å –°—Ç–∏–Ω–≥–æ–Ω–µ (9.08.1991), –ò—Ç–∞–ª–∏—è, —É–∫–ª–æ–Ω–µ–Ω–∏–µ, –æ—Ç–∫–∞–∑ –∏–ª–∏ –ø—Ä–æ–≤–∞–ª –¥–æ–ø–∏–Ω–≥-—Ç–µ—Å—Ç–∞, 28.05.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 23.01.2018-22.01.2022, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 28.05.2017.</p>
<p>–ê–Ω—Ç–æ–Ω–∏–æ –§–∞—Ä–∏–Ω–∞ (18.07.1987), –ò—Ç–∞–ª–∏—è, 10.09.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 12.10.2017-11.10.2021, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 10.09.2017.</p>
<p>–ö–∞—Ç–µ—Ä–∏–Ω–∞ –°—Ç–µ—Ü–µ–Ω–∫–æ (16.01.1982), –£–∫—Ä–∞–∏–Ω–∞, –±–∏–æ–ª–æ–≥–∏—á–µ—Å–∫–∏–π –ø–∞—Å–ø–æ—Ä—Ç –∞—Ç–ª–µ—Ç–∞, 26.08.2011, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 27.04.2016-26.8.2018, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 26.08.2011 –ø–æ 27.04.2016.</p>
<p>–•–∞–±–∏–± –ú–æ—Å–±–∞—Ö (8.03.1979), –ê–ª–∂–∏—Ä, —Ñ–∏–Ω–∞–ª —á–µ–º–ø–∏–æ–Ω–∞—Ç–∞ –§—Ä–∞–Ω—Ü–∏–∏ –ø–æ –∫—Ä–æ—Å—Å—É, –í–µ—Ä–≥–µ–∑ –§—Ä–∞–Ω—Ü–∏—è, 4.02.2018, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 20.03.2018-19.03.2022, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 4.02.2018.</p>
<p>–î–∂–æ—Ä–¥–∞–Ω –ß–∏–ø–∞–Ω–≥–∞–º–∞ (12.11.1988), –ó–∞–º–±–∏—è, –º–∞—Ä–∞—Ñ–æ–Ω –ì—Ä–∞–¥–º–∞, –î—É–ª—É—Ç –°–®–ê, 17.06.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 15.08.2017-14.08.2021, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 17.06.2017.</p>
<p>–ò—Ö–∞–± –ê–±–¥–µ–ª—å—Ä–∞—Ö–º–∞–Ω (1.05.1989), –ï–≥–∏–ø–µ—Ç, –≤–Ω–µ—Å–æ—Ä–µ–≤–Ω–æ–≤–∞—Ç–µ–ª—å–Ω—ã–π –¥–æ–ø–∏–Ω–≥-—Ç–µ—Å—Ç, –ö–∞—Ñ—Ä –°–∞–∫—Ä –ï–≥–∏–ø–µ—Ç, 17.04.2016, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 21.07.2016-20.07.2020, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 17.04.2016.</p>
<p>–î–∞–≤–∏–Ω–¥–µ—Ä –°–∏–Ω–≥—Ö –ö–∞–Ω–≥ (18.12.1988), –ò–Ω–¥–∏—è, 3-–π –∏–Ω–¥–∏–π—Å–∫–∏–π –ì—Ä–∞–Ω-–ø—Ä–∏, –ù—å—é-–î–µ–ª–∏ –ò–Ω–¥–∏—è, 15.05.2017, –ø—É–±–ª–∏—á–Ω–æ–µ –ø—Ä–µ–¥—É–ø—Ä–µ–∂–¥–µ–Ω–∏–µ</p>
<p>–ü—Ä–∞—à–∞–Ω—Ç –ú–∞–ª–∏–∫ (10.07.1991), –ò–Ω–¥–∏—è, 3-–π –∏–Ω–¥–∏–π—Å–∫–∏–π –ì—Ä–∞–Ω-–ø—Ä–∏, –ù—å—é-–î–µ–ª–∏ –ò–Ω–¥–∏—è, 15.05.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 5.06.2017-4.06.2021, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 15.05.2017.</p>
<p>–†–∞–º–∞–Ω–ø—Ä–∏—Ç –ö–∞—É—Ä (18.01.1995), –ò–Ω–¥–∏—è, –æ—Ç–±–æ—Ä–æ—á–Ω—ã–µ —Å–æ—Ä–µ–≤–Ω–æ–≤–∞–Ω–∏—è –Ω–∞ 22-–π —á–µ–º–ø–∏–æ–Ω–∞—Ç –ê–∑–∏–∏, –ü–∞—Ç–∏–∞–ª–∞ –ò–Ω–¥–∏—è, 26.06.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 9.08.2017-8.08.2021, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 26.06.2017.</p>
<p>–î–∂–∞–≥—Ç–∞—Ä –°–∏–Ω–≥—Ö (1.05.1993), –ò–Ω–¥–∏—è, 21-–π —Ñ–µ–¥–µ—Ä–∞–ª—å–Ω—ã–π –∫—É–±–æ–∫, –ü–∞—Ç–∏–∞–ª–∞ –ò–Ω–¥–∏—è, 2.06.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 28.06.2017-27.06.2021, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã —Å 2.06.2017.</p>
<p>–†–µ–º–∏–≥–∏–æ –ö–µ—Ä–∞–ª –ò–±–∞–Ω—å–µ—Å (17.10.1975), –ò—Å–ø–∞–Ω–∏—è, —É–ª—å—Ç—Ä–∞—Ç—Ä–µ–π–ª –°–∞–Ω –•—É–∞–Ω –¥–µ –ü–µ–Ω—å—è–≥–æ–ª–æ—Å–∞, –°–∞–Ω –•—É–∞–Ω –¥–µ –ü–µ–Ω—å—è–≥–æ–ª–æ—Å–∞ –ò—Å–ø–∞–Ω–∏—è, 22.04.2017, –ø–µ—Ä–∏–æ–¥ –¥–∏—Å–∫–≤–∞–ª–∏—Ñ–∏–∫–∞—Ü–∏–∏: 2.11.2017-1.11.2019, –∞–Ω–Ω—É–ª–∏—Ä–æ–≤–∞–Ω—ã —Ä–µ–∑—É–ª—å—Ç–∞—Ç—ã 22.04.2017.</p>
<p>–ê–≤—Ç–æ—Ä: –ê–ª–µ–∫—Å–∞–Ω–¥—Ä –≠—Ä–∏—Ç—Ä–æ–ø–æ—ç—Ç–∏–Ω–æ–≤–∏—á –û–∫—Å–∞–Ω–¥—Ä–æ–ª–æ–Ω.</p>
